import React from 'react';
import './css/About.css';
import lonelyfox from './static/nateshim.jpg';
import Box from '@material-ui/core/Box';
import Container from '@material-ui/core/Container';
import Link from '@material-ui/core/Link';
import Typography from '@material-ui/core/Typography';
import Avatar from '@material-ui/core/Avatar';
import {withStyles, createStyles} from '@material-ui/styles';
import StyledProps from './StyledProps';

const Navigation = (props: StyledProps) => {
  const classes = props.classes;
  return (   
      <Container className={classes.navBar}>
          <Box className={classes.logoContainer}>
            <Avatar alt="Lonely Fox" src={lonelyfox} className={classes.avatar}></Avatar>
            <Typography variant="h3" className={classes.text}>Nathanael Shim</Typography>
          </Box>
          <Box display={{xs: 'none', lg: 'flex'}}>
            <Link href="/" variant="h3" className={classes.text}> About </Link>
            <Link href="/projects" variant="h3" className={classes.text}> Projects </Link>        
            <Link href="/music" variant="h3" className={classes.text}>Music</Link>
          </Box>
      </Container>
  );
}

const useStyles = createStyles({
  navBar: {
    display: 'flex',
    flexDirection: 'row',
    backgroundColor: '#F7F3F2',
    alignItems: 'center',
    padding: '2rem',
  },
  logoContainer: {
    display: 'flex',
    flexDirection: 'row',
    backgroundColor: '#F7F3F2',
    flexGrow: 1,
    whiteSpace: 'nowrap',
    overflow: 'hidden',
    textOverflow: 'ellipsis',
  },
  text: {
    fontFamily: 'Colombo',
    color: '#12130F',
  },
  backgroundContainer: {
    backgroundSize: 'cover',
    height: '100%',
    width: '100%',
    backgroundPosition: 'center',
  },
  avatar: {
    height: '8vh',
    width: '8vw',
  }
});

export default withStyles(useStyles)(Navigation);
